class Solution:
    def longestPalindrome(self, s: str) -> str:
        if not s or len(s)==0:return ""
        result=""
        for i in range(len(s)):
            if i< len(s) and len(result)<len(self.Palindrome(s,i,i)):
                result=self.Palindrome(s,i,i)
            if i< len(s) and len(result)<len(self.Palindrome(s,i,i+1)):
                result=self.Palindrome(s,i,i+1)
        return result
            

    def Palindrome(self,s,low,high):
        while low>=0 and high<len(s) and s[low]==s[high]:
            low -=1
            high +=1

        return s[low+1:high]




